import useServices from "../../hooks/useServices";
import { ErrorMessage } from "../errorMessage/ErrorMessage";
import { ServicesList } from "../servicesList/ServicesList";
import { AuthContext } from "../../context/AuthContext";
import { useContext } from "react";
/* import { Service } from "../service/Service"; */



export const UserServices = (id) => {
  const { services, loading, error } = useServices(id);
  const { user } = useContext(AuthContext);

  console.log(user.user.id);
  console.log(id.idUser);




  /* 


  {services.map((service) => {
            if (service.idUser === user.user.id){
             returnServices.map(service)
           }
           }
         }
    */

  if (loading) return <p>Loading services...</p>;
  if (error) return <ErrorMessage message={error} />;

  {user && user.id === id.idUser ? <ServicesList services={services} id={user.id} key={services.idUser}/> : "Este usuario no tiene creado nigún servicio"}


  return <ServicesList services={services} idUser={id.idUser} />;
};
